*
 * 点击购买的书记录更多，显示菜单
 *
 * 支持平台：书旗iOS
 *
 * @param {Object} params - 调用客户端桥所需要的参数
 * @param {string} params.bid - 书籍ID
 * @param {string} params.title - 二级页面title
 * @param {string} params.topclass -
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('show-menu-with-bid', {
 *    params: {
 *      bid: '1',
 *      title: 'title',
 *      topClass: 'topClass'
 *    }
 *  }).catch(function (err) {
 *    alert('[from ready][show-menu-with-bid][error] ' + JSON.stringify(err, null, 2));
 *    alert(err.detail.__$rawError__.stack);
 *  });
 *

